import { Button, StyleSheet, Text, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import AuthLogin from "./components/admin/AuthLogin";
import Rooms from "./components/admin/Rooms";
import Client from "./components/Client";
import { Linking } from "react-native";

const Stack = createNativeStackNavigator();

const Welcome = () => {
	return (
		<View>
			<Text>Welcome</Text>
		</View>
	);
};

export default function App() {
	return (
		<NavigationContainer>
			<Stack.Navigator>
				<Stack.Screen name="/Home" component={Welcome} options={{ title: "Welcome" }} />
				<Stack.Screen name="/room" component={Client} options={{ title: "Room" }} />
				<Stack.Screen name="/admin" component={Rooms} options={{ title: "Rooms Admin" }} />
				<Stack.Screen name="/login" component={AuthLogin} />
			</Stack.Navigator>
		</NavigationContainer>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
		alignItems: "center",
		justifyContent: "center",
	},
});
